def get_dic(tran,index ='1',state_num = 7, title =  None):
    sums = [get_sum(i) for i in tran[index].keys()]
    combs = []
    dic ={}
    dic_prob = {}
    for i in tran[index].keys():
        sum_key = get_sum(i)
    
        if sum_key  not in dic_prob:
            dic_prob[sum_key] = tran[index][i]
        else:
            dic_prob[sum_key] += tran[index][i]


    for i in range(0,state_num +1):
        combs.append(math.comb(state_num,i))
    combs = np.array(combs)
    sort_dic = dict(sorted(dic_prob.items()))
    print(" ")
    print(title)
    df = pd.DataFrame(data ={'num_dose_effective': list(sort_dic.keys()),
                             'combination_prob': combs/np.sum(combs), 
                             'markov_prob':list(sort_dic.values())})
    print(df)
    



